window.onload = function() { var fontLink = document.createElement('link'); fontLink.rel = 'stylesheet'; fontLink.href = 'https://fontlibrary.org/face/minecraftia'; document.body.append(fontLink); const minecraftButtons = document.getElementsByClassName("minecraft-button"); for(let i = 0;i<minecraftButtons.length;i++){ minecraftButtons[i].style.backgroundImage = "url('data:image/png;base64,')"; minecraftButtons[i].style.fontFamily = "'Minecraftia',sans-serif"; minecraftButtons[i].style.borderColor = "#AAA #565656 #565656 #AAA"; minecraftButtons[i].style.color = "white"; minecraftButtons[i].style.fontSize = "large"; minecraftButtons[i].style.padding = "15px 20px"; minecraftButtons[i].style.outline = "2px solid #000;"; minecraftButtons[i].style.cursor = "pointer"; minecraftButtons[i].onclick = function(){let sound = new Audio("data:audio/mpeg;base64,") ;sound.currentTime = 0.6; sound.play() }; minecraftButtons[i].onmouseover = function(){ this.style.backgroundImage = "url('data:image/png;base64,')" };minecraftButtons[i].onmouseout = function(){ this.style.backgroundImage = "url('data:image/png;base64,')"; } } };
